import { makeObservable, observable, action, computed } from "mobx"

export class Square {
    id = Math.random()
    type

    constructor(type = 0) {
        makeObservable(this, {
            type: observable,
            getType: computed,
            changeType: action
        })
        this.type = type
    }

    get getType() {
        return this.type
    }

    changeType(type) {
        this.type = type
    }
}

